	add("health", "{\"term\":\"health\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027lang\u003denm\u0027 from Old english (ca. 450-1100) {{m|ang|hǣlþ}}, ultimately from West Proto-germanic {{m|gem-pro|*hailiþō}}, from Proto-germanic {{m|gem-pro|*hailaz||whole, hale}}. Cognate with Old High German \u0027heilida\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being free from physical or psychological disease, illness, or malfunction; wellness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dThen he commenced to talk, really talk. and inside of two flaps of a herring\u0027s fin he had me mesmerized, like Eben Holt\u0027s boy at the town hall show. He talked about the ills of humanity, and the glories of \u0027\u0027health\u0027\u0027 and Nature and service and land knows what all\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A state of well-being or balance, often physical but sometimes also mental and social; the overall level of function of an organism from the cellular (micro) level to the social (macro) level\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Physical condition\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Cure, remedy\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Bk.XVII, Ch.XI\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And she myght have a dysshfulle of bloode of a maydyn and a clene virgyne in wylle and in worke, and a kynges doughter, that bloode sholde be her \u0027\u0027helth\u0027\u0027, for to anoynte her withall\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A toast to prosperity\", \"priority\":8}]}, \"synonyms\":{}}");

