	add("heart", "{\"term\":\"heart\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027herte\u0027 from Old english (ca. 450-1100) \u0027heorte\u0027 (heart) from Proto-germanic {{m|gem-pro|*hertô||heart}}, from Proto-indo-european {{m|ine-pro|*ḱḗr||heart}}. Germanic cognates: see {{m|gem-pro|*hertô}}. The Indo-European root is also the source of Latin \u0027cor\u0027 \u0027cordis\u0027, Greek \u0027καρδιά\u0027 Welsh \u0027craidd\u0027 Irish \u0027croí\u0027 Armenian \u0027սիրտ\u0027 Russian \u0027се́рдце\u0027 Lithuanian \u0027širdis\u0027 and Albanian \u0027kërthizë\u0027 (navel, central spot)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A muscular organ that pumps blood through the body, traditionally thought to be the seat of emotion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Emotions, kindness, moral effort, or spirit in general\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The team lost, but they showed a lot of \u0027\u0027heart\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, \u0026quot;Rights trampled in rush to deport immigrant workers,\u0026quot; \u0027Quaker Action\u0027 (magazine), vol. 89, no. 3, page 8\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;We provided a lot of brains and a lot of \u0027\u0027heart\u0027\u0027 to the response when it was needed,\u0026quot; says Sandra Sanchez, director of AFSC\u0027s Immigrants\u0027 Voice Program in Des Moines\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Here is my secret. It is very simple: It is only with the \u0027\u0027heart\u0027\u0027 that one can see rightly; what is essential is invisible to the eye.\u0027 (, \u0027s:en:The Little The Little Prince\u0027, 1943\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The seat of the affections or sensibilities, collectively or separately, as love, hate, joy, grief, courage, etc.; rarely, the seat of the understanding or will; usually in a good sense\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a good, tender, loving, bad, hard, or selfish \u0027\u0027heart\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Courage; courageous purpose; spirit\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Eve, recovering \u0027\u0027heart\u0027\u0027, replied\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Sir W. Templ\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The expelled nations take \u0027\u0027heart\u0027\u0027, and when they fly from one country invade another\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Vigorous and efficient activity; power of fertile production; condition of the soil, whether good or bad\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"That the spent earth may gather \u0027\u0027heart\u0027\u0027 again\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"I speak to thee, my \u0027\u0027heart\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A conventional shape or symbol used to represent the heart, love, or emotion: ♥ or sometimes \u0026lt;3\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Pat Cadigan, \u0027Tea From an Empty Cup\u0027, page 106\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"quot;Aw. Thank you.\u0026quot; The Cherub kissed the air between them and sent a small cluster of tiny red \u0027\u0027hearts\u0027\u0027 at her\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A playing card of the suit hearts featuring one or more heart-shaped symbols\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"The centre, essence, or core\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"The wood at the \u0027\u0027heart\u0027\u0027 of a tree is the oldest\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Buddhists believe that suffering is right at the \u0027\u0027heart\u0027\u0027 of all life\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"1899\u0027\u0027, w:Robert Barr Robert Barr, \u0027The Strong Arm\u0027, ch. 3\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"At last she spoke in a low voice, hesitating slightly, nevertheless going with incisive directness into the very \u0027\u0027heart\u0027\u0027 of the problem\", \"priority\":27}]}, \"synonyms\":{}}");

