	add("hearsay", "{\"term\":\"hearsay\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"1525–35; from phrase \u0027by hear say\u0027, translation of Middle French \u0027par ouïr dire\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"information that was heard by one person about anothe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"evidence based on the reports of others rather than on personal knowledge; normally inadmissible because not made under oat\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"evidence: an out-of-court statement offered in court for the truth of the matter asserted; normally inadmissible because not subject to cross-examination, unless the hearsay statement falls under one of the many exceptions\", \"priority\":3}]}, \"synonyms\":{}}");

	add("hearse", "{\"term\":\"hearse\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"oscan\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|herce}}, from {{m|la|hercia}}, from Latin {{m|la|herpicem}}, {{m|la|hirpex}}; ultimately from Oscan {{m|osc|𐌇𐌉𐌓𐌐𐌖𐌔||wolf}}, a reference to the teeth. The Oscan term is related to Latin {{m|la|hirsutus||bristly, shaggy}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hind in the second year of its age\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A framework of wood or metal placed over the coffin or tomb of a deceased person, and covered with a pall; also, a temporary canopy bearing wax lights and set up in a church, under which the coffin was placed during the funeral ceremonies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A grave, coffin, tomb, or sepulchral monument\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Ben Jonso\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"underneath this marble \u0027\u0027hearse\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Fairfa\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Beside the \u0027\u0027hearse\u0027\u0027 a fruitful palm tree grows\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Longfello\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"who lies beneath this sculptured \u0027\u0027hearse\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A bier or handbarrow for conveying the dead to the grave\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Set down, set down your honourable load, / If honour may be shrouded in a \u0027\u0027hearse\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A carriage or vehicle specially adapted or used for transporting a dead person to the place of funeral or to the grave\", \"priority\":13}]}, \"synonyms\":{}}");

	add("heartbeat", "{\"term\":\"heartbeat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|heart|beat|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One pulsation of the heart; especially an irregular one, hence the emotion which causes it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The policeman waited for a \u0027\u0027heartbeat\u0027\u0027 in vain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He alone gives me such \u0027\u0027heartbeats\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The rhythm at which a heart pulsates, a cardiac indicato\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"If your \u0027\u0027heartbeat\u0027\u0027 doesn\u0027t normalize soon, consult a doctor\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A driving impulse or vital force\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Music is the \u0027\u0027heartbeat\u0027\u0027 of the people\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A very short space of time; an instant\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The ambulance arrived in a \u0027\u0027heartbeat\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A periodic signal generated by hardware or software to indicate normal operation or to synchronize other parts of a system\", \"priority\":10}]}, \"synonyms\":{}}");

	add("heartbreak", "{\"term\":\"heartbreak\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027heart\u0027 + \u0027break\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"overwhelming mental anguish or grief, especially that caused by loss or disappointmen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("heartbreaker", "{\"term\":\"heartbreaker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027heartbreak\u0027 + \u0027-er\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone, usually attractive, who flirts with or otherwise enamours a person, but does not reciprocate their love\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Alison Pace, \u0027If Andy Warhol Had a Girlfriend\u0027, Penguin (ISBN 9781440684616\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It wasn\u0026amp\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"39;t an actual run-in with the \u0027\u0027heartbreaker\u0027\u0027 himself, but with a very good friend of his. It\u0026amp\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"39;s actually much better that way, Victor explained, because seeing the friend of the person who stepped on your heart isn\u0026amp\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"39;t going to kill you all over again\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Lynn Price, \u0027Donovan\u0027s Paradigm\u0027, Behler Publications (ISBN 9781933016573), page 23\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;And this little lovely standing next to him is my favorite \u0027\u0027heartbreaker\u0027\u0027, The Fair Lady Sara from Samaria. Kids, this is Dr. Donovan.\u0026quot; Sara beamed, obviously thrilled at being considered anyone\u0026amp\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"39;s \u0027\u0027heartbreaker\u0027\u0027, especially Uncle Erik\u0026amp\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Andrea J Buchanan, \u0027It\u0027s a Boy: Women Writers on Raising Sons\u0027, Seal Press (ISBN 9780786746323), page 14\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I imagined him as the kind of boy who knows girls are equals; the teen with female friends as well as male; then a kind man, a good man, the kind of man who knows better than to be a \u0027\u0027heartbreaker\u0027\u0027, despite his looks\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Something that causes sorrow, grief or extreme disappointment\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, James Ellroy, \u0027White Jazz\u0027, Vintage (ISBN 9780307798428), page 34\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"He\u0026amp\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"39;s not lucid most of the time, and that\u0026amp\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"39;s a \u0027\u0027heartbreaker\u0027\u0027. The LAPD will not release details on the altercation that earned Dudley Smith his wounds; they know he would prefer to spare the family of the robber he killed the ignominy of public\u0026amp;nbsp\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, George Saunders, \u0027The Braindead Megaphone\u0027, Penguin (ISBN 9781101217474\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"It\u0026amp\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"39;s a \u0027\u0027heartbreaker\u0027\u0027, as I was reminded just now when I went to get the chapter reference, reread it, and started bawling\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Bobbi Sheahan, Kathy DeOrnellas, \u0027What I Wish I\u0027d Known about Raising a Child with Autism: A Mom and a Psychologist Offer Heartfelt Guidance for the First Five Years\u0027, Future Horizons (ISBN 9781935274230), page 19\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"It\u0026amp\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"39;s a \u0027\u0027heartbreaker\u0027\u0027. The worst part of that situation was trying to console Grace. It was just awful. Don\u0026amp\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"39;t let experiences like this make you bitter. The truth is, our kids are a challenge, and not everyone is going to want to join us in this journey\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"A match which ends in defeat for a promising player or team\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Mark Stallard, \u0027Tales from the Jayhawks Gridiron\u0027, Sports Publishing LLC (ISBN 9781582617916), page 16\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Kansas appeared in its first bowl following the 1947 season, losing a \u0027\u0027heartbreaker\u0027\u0027 to Georgia Tech in the Orange Bowl. KU landed in the Bluebonnet Bowl following the 1961 season, and beat up a good Rice squad, 33-7\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Tom Benjey, \u0027Keep A-goin\u0027: The Life of Lone Star Dietz\u0027, Tuxedo Press (ISBN 9780977448609), page 24\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Wyoming lost a \u0027\u0027heartbreaker\u0027\u0027 7–6. Utah\u0026amp\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"39;s touchdown was scored on an intercepted pass, Wyoming missed an extra point and, most importantly, an official did not get downfield in time to see a punt hit a Utah player not once, but twic\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Dieter Dubberke, \u0027Three Times Blessed\u0027, Xlibris Corporation (ISBN 9781462817849), page 9\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"In 1988 and again in 1989 the team went back to Bristol, Connecticut, for the nationals, coming in at third place one year and in second place another, losing the championship to Wisconsin-Oshkosh in a \u0027\u0027heartbreaker\u0027\u0027 in eleven innings\", \"priority\":31}]}, \"synonyms\":{}}");

	add("heartful", "{\"term\":\"heartful\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|heart|ful|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An amount of emotion considered to be present in the heart\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, William Edward Burghardt Du Bois, \u0027The souls of black folk: essays and sketches\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"How many \u0027\u0027heartfuls\u0027\u0027 of sorrow shall balance a bushel of wheat\", \"priority\":3}]}, \"synonyms\":{}}");

	add("hearth", "{\"term\":\"hearth\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027herth\u0027 from Old english (ca. 450-1100) \u0027heorþ\u0027 from Proto-germanic {{m|gem-pro|*herþaz}}, from Proto-indo-european {{m|ine-pro|*ker-||heat; fire}}. Cognate with West Frisian \u0027hurd\u0027 Dutch \u0027haard\u0027 German \u0027herd\u0027 Swedish \u0027härd\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A brick, stone or cement floor to a fireplace or oven\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"When the flames at last began to flicker and subside, his lids fluttered, then drooped ; but he had lost all reckoning of time when he opened them again to find Miss Erroll in furs kneeling on the \u0027\u0027hearth\u0027\u0027 and heaping kindling on the coals, and her pretty little Alsatian maid beside her, laying a log across the andirons\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An open recess in a wall at the base of a chimney where a fire may be built\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The lowest part of a metallurgical furnace\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A symbol for home or family life\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A household or group following the modern pagan faith of Heathenry\", \"priority\":6}]}, \"synonyms\":{}}");

	add("hearthside", "{\"term\":\"hearthside\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|hearth|side|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The area around the fireplace in the living-room of a family house\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Tuesday January 11, 2000\u0027\u0027,The Guardian, Judi James\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Working women are stressing out their male partners by discussing business problems around the family \u0027\u0027hearthside\", \"priority\":3}]}, \"synonyms\":{}}");

	add("hearthstone", "{\"term\":\"hearthstone\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"Middle english (1100-1500) {{compound|hearth|stone|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flat stone used to form a hearth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"By extension: The fireside, home life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1846\u0027\u0027, w:Ralph Waldo Ralph Waldo Emerson, \u0026quot;Good-Bye\u0026quot;, line 1\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I am going to my own \u0027\u0027hearth-stone\u0027\u0027, / Bosomed in yon green hills alone\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1861\u0027\u0027, w:Abraham Abraham Lincoln, \u0027s:Abraham Lincoln\u0027s first inaugural First inaugural addres\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The mystic chords of memory, stretching from every battle-field, and patriot grave, to every living heart and \u0027\u0027hearth-stone\u0027\u0027, all over this broad lan\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1876\u0027\u0027, w:Richard J. Richard J. Hinton, \u0027English Radical Leaders\u0027, page 5\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The denominational relations of a household will shape the future political positions of the young men growing around the \u0027\u0027hearth-stone\u0027\u0027, just as they did those of their father\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A soft kind of stone used to whiten door-steps, scour floors, etc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1861\u0027\u0027, w:Henry Henry Mayhew, \u0027London labour and the London Poor\u0027, vol. 1, page 2\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Lastly, there is the \u0027\u0027hearth-stone\u0027\u0027 barrow, piled up with hearth-stone, Bath-brick and lumps of whiting\", \"priority\":11}]}, \"synonyms\":{}}");

	add("heartlessness", "{\"term\":\"heartlessness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|heartless|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the characteristic of being heartless\", \"priority\":1}]}, \"synonyms\":{}}");

	add("heartline", "{\"term\":\"heartline\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|heart|line|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A line on the palm supposed to reflect a person\u0027s emotional state\", \"priority\":1}]}, \"synonyms\":{}}");

