	add("hearts", "{\"term\":\"hearts\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the four suits of playing cards, in red, marked with the symbol ♥\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A trick-taking card game in which players are penalized for taking hearts and (especially) the queen of spades\", \"priority\":2}]}, \"synonyms\":{}}");

	add("heartstrings", "{\"term\":\"heartstrings\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|heart|strings|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tendons once thought to brace the heart\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I.iii.2.4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The midriff and \u0027\u0027heart-strings\u0027\u0027 do burn and beat very fearfully, and when this vapour or fume is stirred, flieth upward, the heart itself beats\u0026amp;nbsp;[…\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One\u0027s deepest emotions or inner feelings\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The cord-like tendons that connect the papillary muscles to the tricuspid valve and the mitral valve in the heart\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Beryl Stretch, \u0027BTEC National Health Studies\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"These are the so-called \u0027\u0027heartstrings\u0027\u0027 or chordae tendineae\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Crissy Shreve, \u0027BMom\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"As a result, one or more of his \u0027chordae tendineae\u0027, or \u0027\u0027heartstrings\u0027\u0027, ruptured\", \"priority\":9}]}, \"synonyms\":{}}");

